const PricingItem = ({ Round, dollar, bonus }) => {

    return (
      <div className="col-lg-3 col-sm-6 col-xs-12">
        <div className="pricing-item ">
          <h4>{Round}</h4> 
          {Round==='Private' && <div className="pricing">starts on February 1<sup>st</sup> to ends on February 15<sup>th</sup></div>}
          <span>1 BNB = 200.000.000 Token</span>

          <div className="pricing">15,000,000 Token</div>
          <label><strong>{bonus} bonus</strong></label>
        </div>
      </div>
    );
}

export default PricingItem;
